## Answer (0)

You can use a single state variable to keep track of the currently open tooltip. When a new tooltip is opened, close the previous one.

```
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [currentTooltip, setCurrentTooltip] = useState(null);

  const openTooltip = (text) => {
    setCurrentTooltip(text);
  };

  const closeTooltip = () => {
    setCurrentTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ currentTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
```

```
import React from 'react';
import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ text, children }) => {
  const { currentTooltip, openTooltip, closeTooltip } = useTooltip();

  return (
    <div
      onMouseEnter={() => openTooltip(text)}
      onMouseLeave={closeTooltip}
      onClick={closeTooltip}
    >
      {children}
      {currentTooltip === text && (
        <div className="tooltip">
          <p>{currentTooltip}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

